import './App.css';
import Header from './components/Header';
import Button from './components/button';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="choice">
        <Button title="New Canvas"/>
        <Button title="Load Canvas"/>
      </div>
    </div>
  );
}

export default App;
